    <style>
        * {
            margin: 0;
            padding: 0;
            border: 0;
            box-sizing: border-box;
        }

        html {
            font-size: 26px;
            line-height: 1.5em;
        }

        body {
            overflow: hidden;
            font-family: "Roboto", Helvetica, Calibri;
            color: #371100;
            background-color: #fbfbfb;
            position: relative;
        }

        .error-page-main {
            text-align: center;
            height: 100vh;
            width: 100vw;
            display: table-cell;
            vertical-align: middle;
            background-image: url("/images/top-svg.svg"), url("/images/middle-svg.svg"), url("/images/bottom-svg.svg");
            background-position: top right, center, bottom;
            background-repeat: no-repeat;
        }

        .onebanc-logo {
            height: 6rem;
        }

        .text-nothing-to-see {
            margin-top: 1rem;
            font: large;
        }

        .home-button {
            border: none;
            font-size: 1rem;
            font-weight: 600;
            margin-top: 1rem;
            padding: 0.6rem 2.5rem;
            background: #d26f26;
            border-radius: 5px;
            color: #fff;
            width: 15rem;
            line-height: 1.3rem;
            cursor: pointer;
        }

        .graphic-404 {
            margin-top: 1rem;
        }

        .graphic-404-svg {
            height: 10rem;
        }

        .footer {
            text-align: center;
            position: absolute;
            width: 100%;
            bottom: 2vh;
            font-size: 0.9rem;
            line-height: 1.5em;
            font-weight: 400;
        }

        #bump {
            animation: bump-animation alternate 1s infinite;
        }

        #Path_1061 {
            animation: eyebrow-animation linear 1s infinite alternate;
        }

        @keyframes bump-animation {
            0% {
                transform: translate(81.58%, 15%);
            }

            100% {
                transform: translate(81.79%, 16.8%);
            }
        }

        @keyframes eyebrow-animation {
            0% {
                transform: translate(-17%, -38%)
            }

            100% {
                transform: translate(-16%, -43%);
            }
        }

        @media only screen and (max-width:1540px) {
            html {
                font-size: 21px;
                line-height: 1.5em;
            }
        }

        @media only screen and (max-width:1300px) {
            html {
                font-size: 20px;
                line-height: 1.5em;
            }
        }

        @media only screen and (max-width:1100px) {
            html {
                font-size: 16px;
                line-height: 1.4em;
            }

            .error-page-main {
                background-size: 50vh,auto,50vh;
            }

            .graphic-404-svg {
                height: 8rem;
            }
        }

        @media only screen and (orientation: portrait) {
            html {
                font-size: 24px;
                line-height: 1.5em;
            }

            .error-page-main {
                background-size: 40vh,auto,40vh;
            }

            .onebanc-logo {
                height: 8rem;
            }

            .graphic-404-svg {
                height: 12rem;
            }
        }

        @media only screen and (max-width:800px) {
            html {
                font-size: 19px;
                line-height: 1.5em;
            }
        }

        @media only screen and (max-width:550px) {
            html {
                font-size: 15px;
                line-height: 1.5em;
            }
        }

        @media only screen and (max-width:428px) {
            html {
                font-size: 13px;
                line-height: 1.5em;
            }
        }
    </style>
